import React, { useEffect, useState } from 'react'
import styled from 'styled-components'
import QRcode from 'react-qr-code';
import { NavLink } from 'react-router-dom'
import house from '../Images/house.png'

const Contact: React.FC = () => {
const [qrsize, setqrsize] = useState(87)

useEffect(() => {
    axios.get('https://api.coingecko.com/api/v3/simple/price?ids=Cethereum%2Czombie-finance&vs_currencies=usd').then((res) => {
      if (res.status === 200) {
        setZomPrice(Number(res.data['zombie-finance'].usd))
      }
    })
    axios.get('https://api.coingecko.com/api/v3/simple/price?ids=Cethereum%2Cshrimp-finance&vs_currencies=usd').then((res) => {
      if (res.status === 200) {
        setShrimpPrice(Number(res.data['shrimp-finance'].usd))
      }
    })
    axios.get('https://api.coingecko.com/api/v3/coins/shrimp-finance?tickers=false&developer_data=false&sparkline=false').then((res) => {
      if (res.status === 200) {
        console.log(res.data)
      }
    })
  }, [setZomPrice, setShrimpPrice])

    return (
        <StyledContainer>
            <StyledSectionsHolder>
        <StyledSections to='/' exact><img width="30px" height="30px" src={house} alt='house to show that this is a button to home'/></StyledSections>
        </StyledSectionsHolder>
            <StyledInnerContainer>
                <StyledInnerGrouping>
            <QRcode size={87} value={"https://t.me/SamInTaiwan"} />
            <StyledLink target='_self' href="https://t.me/SamInTaiwan">Telegram</StyledLink>
            </StyledInnerGrouping>
            <HorizontalSpacer />
            <StyledInnerGrouping>
            <QRcode size={87} value={"https://line.me/R/ti/p/samdepramere"} />
            <StyledLink target='_self' href="https://line.me/R/ti/p/samdepramere">Line</StyledLink>
            </StyledInnerGrouping>
            <HorizontalSpacer />
            <StyledInnerGrouping>
            <QRcode size={87} value={"https://wa.me/886975139873"} />
            <StyledLink target='_self' href="https://wa.me/886975139873">WhatsApp</StyledLink>
            </StyledInnerGrouping>
            </StyledInnerContainer>
            <StyledInnerContainer>
            <StyledInnerGrouping>
            <QRcode size={87} value={"https://twitter.com/CryptoOwl3"} />
            <StyledLink target='_self' href="https://twitter.com/CryptoOwl3">Twitter</StyledLink>
            </StyledInnerGrouping>
            <HorizontalSpacer />
            <StyledInnerGrouping>
            <QRcode size={87} value={"87daysofsam@gmail.com"} />
            <StyledLink target='_self' href="mailto:87daysofsam@gmail.com">Email</StyledLink>
            </StyledInnerGrouping>
            </StyledInnerContainer>
        </StyledContainer>
    )
}
const VerticalSpacer = styled.div`
height: 5px;
`
const HorizontalSpacer = styled.div`
width: 25px;
`

const StyledContainer = styled.div`
display: flex;
flex-flow: column;
margin-left: auto;
margin-right: auto;
border-radius: 4px;
justify-content: center;
width: 80%;
height: 90%;
background-color: #008B8B;
`
const StyledInnerContainer = styled.div`
display: flex;
flex-flow: row;
margin-top: 80px;
margin-left: auto;
margin-right: auto;
justify-content: center;
width: 80%;
height: 15%;
`
const StyledLink = styled.a`
text-decoration: none;
color: #8b0000;
cursor: pointer;
`
const StyledInnerGrouping = styled.div`
width: 33%;
height: 100px;
display: flex;
flex-direction: column;
align-items: center;
`

const StyledSections = styled(NavLink)`
    height: 10%;
    width: 10%;
    padding:2%;
`
const StyledSectionsHolder = styled.nav`
    position: absolute;
    color:unset;
    text-decoration: none;
    top: 3%;
    left: 3%;
    height: 15%;
    width: 15%;
    display: flex;
`

export default Contact
